         "When personal information is no longer needed, we have processes in place to securely delete it, for example by erasing electronic files and shredding physical records." : "[島の第~When personal information is no longer needed, we have processes in place to securely delete it, for example by erasing electronic files and shredding physical records.]",
         "Your Rights" : "[島の第~Your Rights]",
         "You have certain rights when it comes to the handling of your personal information. The Contact Us form found in the link in the header of this page can be used to:" : "[島の第~You have certain rights when it comes to the handling of your personal information. The Contact Us form found in the link in the header of this page can be used to:]",
         "    request access to the personal information that we have on you, or have it updated. Depending on the applicable law, you may have additional rights concerning your personal information." : "[島の第~    request access to the personal information that we have on you, or have it updated. Depending on the applicable law, you may have additional rights concerning your personal information.]",
